import './App.css';
import { TextField } from '@mui/material';
import Checkbox from '@mui/material/Checkbox';
import { Button } from '@mui/material';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';

function App() {

  //js code

  return (
    <div>
      <div className='container '>
        <div className="row">
          <div className="col-md-4"></div>
          <div className="col-md-4">
            <h1 className='text-center mt-5 '>Registration Form</h1>
            <form className='mt-5 border border-dark rounded p-5 bg-light '>
              <div className="mb-3">
              <TextField className='w-100' id="standard-basic" label="Email" variant="standard" />
                <div id="emailHelp" className="form-text ">We'll never share your email with anyone else.</div>
              </div>
              <div className="mb-3">
              <TextField className='w-100' id="standard-basic" label="Password" variant="standard" type='password'/>
              </div>
              <div className="mb-3">
              <TextField className='w-100' id="standard-basic" label="Confirm Password" variant="standard" type='password'/>
              </div>
              <div className="mb-3 form-check">

              <FormControlLabel control={<Checkbox defaultChecked />} label="Check me out" />  




              </div>
              <p>Already have an account? <a href="">Login</a></p>
              <button type="submit" className="btn btn-primary">Sign Up</button>
            </form>
          </div>
          <div className="col-md-4"></div>
        </div>
      </div>
    </div>
  );
}

export default App;
